function sandbox:ceo_node_title_key( node_key )
	if node_key then
		return "ceo_nodes_title_"..node_key
	else
		return "ceo_node_key_is_nil"
	end
end

function sandbox:get_ceo_node_key( ceo_key, threshold )

	threshold = (threshold and string.format( "%02d", threshold )) or "01"
	
	local ceo_node = self.db_ceo_nodes[ ceo_key ]
	
	if ceo_node then
		if ceo_node.node_key then return ceo_node.node_key, 0 end

		if ceo_node[ threshold ] then return ceo_node[ threshold ].node_key end
		
		for _, tail in ipairs( { "01", "02", "03", "04", "05", "06", "07", "08", "09" } ) do
			if ceo_node[ tail ] then return ceo_node[ tail ].node_key end
		end
	end
	
	return 'unknown', 0
end

function sandbox:get_ceo_key( node_key )

	local ceo_key = self.ceo_node_keys[ node_key ]
	
	if ceo_key then return ceo_key end
	
	return 'unknown'
end


function sandbox:build_ceo_nodes()

	self.ceo_node_keys = {}

	for ceo_key, row in pairs( self.db_ceo_nodes ) do
		if row.node_key then
			self.ceo_node_keys[ row.node_key ] = ceo_key
		else
			for _, tail in ipairs( { "01", "02", "03", "04", "05", "06", "07", "08", "09" } ) do
				if row[ tail ] then
					self.ceo_node_keys[ row[ tail ] ] = ceo_key
				else
					break
				end
			end
		end
	end

end